import React, { useState, useEffect, useRef } from 'react';
import '../styles/global.css';
import { useNavigate } from 'react-router-dom';
import StoryGrid from '../components/StoryGrid';
import { 
  uploadImages, 
  getAllStories, 
  deleteStory, 
  Story, 
  ImageResponse, 
  getImages, 
  analyzeImagesSequentially,
  generateStory,
  StoryGenerationResponse,
  createStory 
} from '../services/api';

const CreateDiaryPage: React.FC = () => {
  const navigate = useNavigate();
  const [showPopup, setShowPopup] = useState(false);
  const [isFading, setIsFading] = useState(false);
  const [stories, setStories] = useState<Story[]>([]);
  const [isUploading, setIsUploading] = useState(false);
  const [uploadedImages, setUploadedImages] = useState<ImageResponse[]>([]);
  const [combinedDescription, setCombinedDescription] = useState<string>('');
  const [isAnalyzing, setIsAnalyzing] = useState(false);
  const [isGeneratingStory, setIsGeneratingStory] = useState(false);
  const [generatedStory, setGeneratedStory] = useState<StoryGenerationResponse | null>(null);
  const fileInputRef = useRef<HTMLInputElement>(null);

  useEffect(() => {
    fetchStories();
    fetchImages();
  }, []);

  const fetchStories = async () => {
    try {
      const fetchedStories = await getAllStories();
      setStories(fetchedStories);
    } catch (error) {
      console.error('Failed to fetch stories:', error);
    }
  };

  const fetchImages = async () => {
    try {
      const images = await getImages();
      setUploadedImages(images);
      console.log('Fetched images:', images);
    } catch (error) {
      console.error('Failed to fetch images:', error);
    }
  };

  useEffect(() => {
    let fadeTimer: NodeJS.Timeout;
    let hideTimer: NodeJS.Timeout;

    if (showPopup) {
      // Start fade out after 1.7 seconds
      fadeTimer = setTimeout(() => {
        setIsFading(true);
      }, 1700);

      // Hide popup after fade out animation (2 seconds + 0.3 seconds for fade out)
      hideTimer = setTimeout(() => {
        setShowPopup(false);
        setIsFading(false);
      }, 2000);
    }

    return () => {
      clearTimeout(fadeTimer);
      clearTimeout(hideTimer);
    };
  }, [showPopup]);

  const handleCreateStory = () => {
    fileInputRef.current?.click();
  };

  const handleFileSelect = async (event: React.ChangeEvent<HTMLInputElement>) => {
    const files = event.target.files;
    if (!files || files.length === 0) return;

    try {
      setIsUploading(true);
      const uploadedImages = await uploadImages(Array.from(files));
      console.log('Successfully uploaded images:', uploadedImages);
      setUploadedImages(uploadedImages);

      // Start analyzing images
      setIsAnalyzing(true);
      const description = await analyzeImagesSequentially(uploadedImages);
      setCombinedDescription(description);
      setIsAnalyzing(false);

      // Generate story
      setIsGeneratingStory(true);
      const storyResult = await generateStory(description);
      setGeneratedStory(storyResult);
      setIsGeneratingStory(false);

      // Save the story
      if (storyResult.title && storyResult.story && uploadedImages.length > 0) {
        const imageUrls = uploadedImages.map(img => img.image_path);
        const storyId = uploadedImages[0].story_id;
        await createStory(storyResult.title, storyResult.story, imageUrls, storyId);
        console.log('Story saved successfully!');
      }
    } catch (error) {
      console.error('Failed to generate story:', error);
      // Handle error appropriately
    } finally {
      setIsUploading(false);
      if (event.target) {
        event.target.value = ''; // Reset file input
      }
    }
  };

  const handleDeleteStory = async (storyId: string) => {
    try {
      await deleteStory(storyId);
      setStories(prev => prev.filter(story => story.id !== storyId));
    } catch (error) {
      console.error('Failed to delete story:', error);
      alert('Failed to delete story. Please try again.');
    }
  };

  const renderDescription = () => {
    if (isAnalyzing) {
      return <p>Analyzing images...</p>;
    }
    if (isGeneratingStory) {
      return <p>Generating story...</p>;
    }
    return (
      <div style={{
        margin: '20px',
        padding: '20px',
        background: 'rgba(255, 255, 255, 0.1)',
        borderRadius: '10px',
        color: 'white',
        width: '100%',
        maxWidth: '800px'
      }}>
        {combinedDescription && (
          <div style={{ marginBottom: '20px' }}>
            <h3>Image Analysis:</h3>
            <p>{combinedDescription}</p>
          </div>
        )}
        {generatedStory && (
          <div>
            {generatedStory.title && (
              <h2 style={{ 
                color: '#FFB6C1',
                marginTop: '20px',
                marginBottom: '10px',
                fontSize: '24px'
              }}>
                {generatedStory.title}
              </h2>
            )}
            <h3 style={{ 
              color: '#87CEEB',
              marginTop: '20px'
            }}>Generated Story:</h3>
            <p style={{
              color: '#FFB6C1',
              whiteSpace: 'pre-wrap',
              lineHeight: '1.6',
              marginTop: '10px'
            }}>{generatedStory.story}</p>
          </div>
        )}
      </div>
    );
  };

  return (
    <>
      <link href="https://fonts.googleapis.com/css2?family=Quicksand:wght@500&display=swap" rel="stylesheet" />
      <div style={{
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'flex-start',
        alignItems: 'center',
        minHeight: '100vh',
        width: '100%',
        background: 'black',
        color: 'white',
        padding: '0 2rem',
      }}>
        <h1 style={{
          fontSize: '3.5rem',
          fontWeight: 'bold',
          marginTop: '2rem',
          marginBottom: '2rem',
          fontFamily: "'SF Pro Display', -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif",
          display: 'flex',
          gap: '15px',
        }}>
          <span style={{
            color: '#87CEEB',
            textShadow: `
              0 0 1px #87CEEB,
              0 0 2px #87CEEB,
              0 0 21px #87CEEB,
              0 0 30px #00BFFF,
              0 0 50px #00BFFF
            `,
          }}>
            Story
          </span>
          <span style={{
            color: 'white',
            textShadow: `
              0 0 1px #fff,
              0 0 2px #fff,
              0 0 21px #fff,
              0 0 30px #fff,
              0 0 50px #fff
            `,
          }}>
            Dashboard
          </span>
        </h1>
        <div style={{ 
          width: '80%', 
          maxWidth: '1200px', 
          position: 'relative',
          display: 'flex',
          justifyContent: 'center'
        }}>
          <div style={{
            position: 'absolute',
            left: '-11rem',
            top: '2rem',
            display: 'flex',
            flexDirection: 'column',
            gap: '1rem',
          }}>
            <button
              onClick={() => navigate('/')}
              style={{
                padding: '0.6rem 1.2rem',
                background: 'rgba(255, 192, 203, 0.15)',
                border: '1px solid rgba(255, 192, 203, 0.3)',
                borderRadius: '8px',
                color: '#FFB6C1',
                cursor: 'pointer',
                transition: 'all 0.3s ease',
                display: 'flex',
                alignItems: 'center',
                gap: '0.5rem',
                fontSize: '0.9rem',
              }}
              onMouseOver={(e) => {
                e.currentTarget.style.background = 'rgba(255, 192, 203, 0.25)';
                e.currentTarget.style.transform = 'translateY(-2px)';
              }}
              onMouseOut={(e) => {
                e.currentTarget.style.background = 'rgba(255, 192, 203, 0.15)';
                e.currentTarget.style.transform = 'translateY(0)';
              }}
            >
              ‚Üê Back to Home
            </button>
            <button
              onClick={handleCreateStory}
              style={{
                padding: '0.6rem 1.2rem',
                background: 'rgba(135, 206, 235, 0.15)',
                border: '1px solid rgba(135, 206, 235, 0.3)',
                borderRadius: '8px',
                color: '#87CEEB',
                cursor: 'pointer',
                transition: 'all 0.3s ease',
                display: 'flex',
                alignItems: 'center',
                gap: '0.5rem',
                fontSize: '0.9rem',
              }}
              onMouseOver={(e) => {
                e.currentTarget.style.background = 'rgba(135, 206, 235, 0.25)';
                e.currentTarget.style.transform = 'translateY(-2px)';
              }}
              onMouseOut={(e) => {
                e.currentTarget.style.background = 'rgba(135, 206, 235, 0.15)';
                e.currentTarget.style.transform = 'translateY(0)';
              }}
            >
              + Create Story
            </button>
          </div>

          <div style={{
            background: 'rgba(255, 255, 255, 0.95)',
            borderRadius: '20px',
            padding: '2rem',
            width: '100%',
            boxShadow: '0 8px 32px rgba(0, 0, 0, 0.1)',
            marginBottom: '3rem'
          }}>
            {stories.length === 0 ? (
              <div style={{
                textAlign: 'center',
                padding: '3rem',
                color: '#666'
              }}>
                <h3>No stories yet</h3>
                <p>Create your first story by clicking the "Create Story" button!</p>
              </div>
            ) : (
              <StoryGrid stories={stories} />
            )}
          </div>
        </div>

        {renderDescription()}

        <input
          type="file"
          ref={fileInputRef}
          style={{ display: 'none' }}
          onChange={handleFileSelect}
          multiple
          accept="image/*"
        />
      </div>
    </>
  );
};

export default CreateDiaryPage;
